import React from "react";
import "./uma-challenge.scss";

const UmaChallenge = () => {
  return (
    <a
      href="https://challenge.uma.tech"
      target="_blank"
      className="challenge-btn">
      Uma.Challenge
    </a>
  );
};
export default UmaChallenge;
